&nbsp;
<p style="text-align: center;"><strong>Darth Maul Typography Warp</strong></p>
<p style="text-align: center;">This was an experimental typography project that we did using Photoshop. I used an image of Darth Maul from Star Wars for my assignment and I typed up a number of lines from the movie which I then replicated a number of times to create blocks of text which I then warped and distorted over the contortions of the face.</p>
